import React from 'react';
import LoginButton from './LoginButton.jsx';
import RegisterButton from './RegisterButton.jsx';
// Header 컴포넌트 정의
function Header() {
  const headerStyle = {
      backgroundColor: '#D4D2E3',
      color: '#5D5A88',
      padding: '20px',
      position: 'relative',
      display: 'flex',
      justifyContent: 'left',
      alignItems: 'center',
      gridArea: 'header',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
    }
  return (
    <header style={headerStyle}>
      <div>
        <h3>⚖️BALANCETALK</h3>
        <RegisterButton name="Login" backgroundColor={"605DEC"} hoverColor={"D4D2E3"}></RegisterButton>
        <RegisterButton name="Register" backgroundColor={"5D5A88"} hoverColor={"D4D2E3"}></RegisterButton>
      </div>
    </header>
  );
}

export default Header;
